(1, 'aboutus', 'HIMSIF', '<h3 style=\"text-align: center;\"><font face=\"Times New Roman\" color=\"#000000\">PROFIL HIMSIF</font></h3><h4><font face=\"Times New Roman\" color=\"#000000\">HIMSIF merupakan salah satu Himpunan Mahasiswa Jurusan (HMJ) yang ada di Universitas Binadarma. HIMSIF berdiri pada tanggal 26-27 Oktober 2001 (Status Perguruan Tinggi saat itu STMIK BINADARMA). HIMSIF merupakan Himpunan Mahasiswa yang terdiri dari dua jurusan falkultas komputer yaitu Manajemen Informatika dan Sistem Informasi. Pada tahun 2002 sampai tahun 2008 HIMSIF sempat fakum dikarenakan tidak ada regenerasi, dan dengan semangat yang tinggi pada tahun 2009 HIMSIF kembali berdiri dengan ketua umum Dewi Sartika dan berdiri sampai sekarang yang dipimpin oleh fajar romadoni.</font></h4><h4><font face=\"Times New Roman\" color=\"#000000\"><br><br>1.Sebagai wadah untuk pengembangan daya fikir, kreatifitas serta minat dan bakat dari mahasiswa/i&nbsp;<br>2.Untuk membina hubungan silahturahim antara mahasiswa manajemen Informatika dan Sistem Informasi&nbsp;<br>3.Menjadikan mahasiswa sesuai dengan tujuan tri darma Perguruan Tinggi</font></h4><h4><font face=\"Times New Roman\" color=\"#000000\"><br></font></h4><h2 style=\"text-align: center; \"><font face=\"Times New Roman\" color=\"#000000\">VISI\r\n&amp; MISI</font></h2><h4><p style=\"language:en-US;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-align:center;direction:ltr;unicode-bidi:embed;mso-line-break-override:\r\nnone;word-break:normal;punctuation-wrap:hanging\"></p><p style=\"text-align: center; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; word-break: normal;\"></p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; word-break: normal;\"></p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; word-break: normal;\"></p></h4><h3 style=\"text-align: center; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; word-break: normal;\"><font face=\"Times New Roman\" style=\"\" color=\"#000000\">VISI&nbsp; :</font></h3><h5 style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; word-break: normal;\"><font face=\"Times New Roman\">Menjadikan HIMSIF sebagai wadah Mahasiswa Sistem Informasi yang memiliki kekeluargaan yang kuat, kreatif, dan inovatif serta memiliki jiwa Enterpeneur dan kapabilitas baik dalam bidang ilmu dan teknologi.</font></h5><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; word-break: normal;\"></p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; word-break: normal;\"></p><p style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; word-break: normal;\"></p><p style=\"text-align: center; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; word-break: normal;\"></p><h3 style=\"text-align: center; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; word-break: normal;\"><font face=\"Times New Roman\" color=\"#000000\">MISI&nbsp; :</font></h3><div class=\"O0\" style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0.38in; direction: ltr; unicode-bidi: embed; word-break: normal;\"><font face=\"Times New Roman\">1.Meningkatkan Kapabilitas dibidang ilmu dan teknologi.</font></div><div class=\"O0\" style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0.38in; direction: ltr; unicode-bidi: embed; word-break: normal;\"><font face=\"Times New Roman\">2.Menciptakan Mahasiswa/I yang memliki jiwa Enterpenuer yang tinggi di bidang IT.</font></div><div class=\"O0\" style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0.38in; direction: ltr; unicode-bidi: embed; word-break: normal;\"><font face=\"Times New Roman\">3.Menciptakan Mahasiswa/I yang kreatif dan Inovatif.</font></div><div class=\"O0\" style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0.38in; direction: ltr; unicode-bidi: embed; word-break: normal;\"><font face=\"Times New Roman\">4.Menjalin kekeluargaan antar Mahasiswa/I, Dosen, dan Kaprodi.</font></div><h5 style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; word-break: normal;\"><font face=\"Times New Roman\" color=\"#000000\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; 5.Melanjutkan Proker yang belum terlaksana di tahun sebelumnya.<br></font></h5><h2 style=\"text-align: center; \"><font face=\"Times New Roman\" color=\"#000000\">STRUKTUR ORGANISASI</font></h2><h3><font face=\"Times New Roman\" color=\"#000000\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp Image 2019-05-06 at 16.22.26.jpeg\" style=\"width: 834px;\"></font><font color=\"#7b8898\" face=\"Times New Roman\"><span style=\"font-size: 26px;\"><b><u><br></u></b></span></font></h3>', '2018-06-30 18:01:03', '2019-05-11 14:48:33');
